import React from "react";
import NewsNavbar from "../components/NewsNavbar";
import Card from "../components/CardCategory";
import "../css/Science.css";

const Category = ({ data }) => {
  console.log(data);
  return (
    <>
      <NewsNavbar />
      <div className="Science">
        {data.map((item, index) => (
          <Card key={index} item={item} />
        ))}
      </div>
    </>
  );
};

export default Category;
